const AddLocation = () => {
  return (
    <div className="addLocationMoodle">
      <button className='button'>Use my current location</button>
      <br/>
      <button>Add by country/state/city</button>
      <br/>
      <button>Add by coordinates</button>
    </div>
  )
}

export default AddLocation
